 The trick here is independent selection! I have to pull each marble from the urn as if it were a fair coin so that any marble has a 1 in 3 chance of being green.  For a fair coin, P(3 heads) = P(3 heads given 2 heads) + P(3 heads given heads) 

                    =  1/8 + 1/8 = 1/4

                    I need to randomly pull 15+15+10 = 40 colored marbles to get a green marble 1/4 of the time. 

                    I calculated 40 / 4 = 10 times.  And good news: I am also done pulling marbles! The probability 
                    problem has been absorbed into the computational problem.


                    */
#include <iostream>
#include <random>
#include <ctime>
#include <algorithm>
#include <vector>
#include <cassert>
using namespace std;

int main(void)
{
  vector<int> vec(11, 0);

  auto myr = std::uniform_int_distribution<>(1, 4);
  size_t nummarbles = 0;
  for(;;){
    auto R = myr(random_device{}(), myr);
    if(R == 3){
      vec[nummarbles] += 1;
      nummarbles += 1;
    }
    if (nummarbles == 10){
      break;
    }
  }
  cout << nummarbles << endl;
  cout << vec[0] << endl;
  cout << vec[1] << endl;
}

